import React, { useEffect, useState } from 'react'
import SelectedMedsList from './SelectedMedsList.js'

export default function Profile(props) {
    const { selectedMeds, setSelectedMeds, getSelectedMeds } = props
    const mySelectedMedList = selectedMeds.map(med => <SelectedMedsList {...med} key={med.rxcui}/>)

    useEffect(() => {
        console.log('useeffect ran')
        getSelectedMeds()
    }, [])

    return (
        <div>
            <p>{mySelectedMedList}</p>
        </div>
    )
}
